              "*/*": {
                "schema": {
                  "type": "string",
                  "enum": [
                    "ADMIN",
                    "NONE",
                    "OWNER",
                    "SUPER_ADMIN",
                    "VIEWER"
                  ]
                }
              }
            }
          },
          "200": {
            "description": "Successfully fetched user\u0027s role",
            "content": {
              "*/*": {
                "schema": {
                  "type": "string",
                  "enum": [
                    "ADMIN",
                    "NONE",
                    "OWNER",
                    "SUPER_ADMIN",
                    "VIEWER"
                  ]
