          "401": {
            "description": "Unauthorized",
            "content": {
              "*/*": {
                "schema": {
                  "type": "string",
                  "enum": [
                    "ADMIN",
                    "NONE",
                    "OWNER",
                    "SUPER_ADMIN",
                    "VIEWER"
                  ]
                }
              }
            }
          }
        },
